/* eslint-disable import/prefer-default-export */
import styled from 'styled-components';

export const WrapperForm = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    height:45px;
    border:1px solid red;
    width:360px;

`;
export const WrapperFormBtn = styled.div`
    display: flex;
    justify-content: center;
    align-items: center;
    height:45px;
    border:1px solid red;

`;
